import './App.css';

export const App=()=>{
  return (
    <>
    <h1>ログイン画面</h1>
    <div>
      <label>メールアドレス</label>
      <input
        name='email'
        type='email'
      />
    </div>
    <div>
      <label>パスワード</label>
      <input
        name='password'
        type='password'
      />
    </div>

    </>
  );
}

export default App;
